import React from 'react';
import Sidebar from '../components/Sidebar';
import { Routes, Route, Navigate } from 'react-router-dom';
import SecretaryComplaints from './secretary/SecretaryComplaints';
import SecretaryBookings from './secretary/SecretaryBookings';
import NoticesPage from './shared/NoticesPage'; // reuse notices page
import SocietyFinancesPage from './shared/SocietyFinancesPage'; // reuse finance view page

export default function SecretaryDashboard() {
  const links = [
    { to: '/secretary/notices', name: 'Notices' },
    { to: '/secretary/complaints', name: 'Complaints' },
    { to: '/secretary/bookings', name: 'Facility Booking' },
    { to: '/secretary/finances', name: 'Society Finances' },
  ];

  return (
    <div className="app-layout">
      <Sidebar links={links} />
      <div className="content">
        <Routes>
          <Route path="/" element={<h2>Welcome Secretary</h2>} />
          <Route path="notices" element={<NoticesPage />} />
          <Route path="complaints" element={<SecretaryComplaints />} />
          <Route path="bookings" element={<SecretaryBookings />} />
          <Route path="finances" element={<SocietyFinancesPage />} />
          <Route path="*" element={<Navigate to="/secretary" replace />} />
        </Routes>
      </div>
    </div>
  );
}
